import React, { useState } from "react";

const Formulario = () => {
  const [formData, setFormData] = useState({
    nombre: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  const [errors, setErrors] = useState({});
  const [focusedField, setFocusedField] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const validate = () => {
    let newErrors = {};

    if (!formData.nombre.trim()) newErrors.nombre = "Campo requerido";
    if (!formData.email.includes("@")) newErrors.email = "Email inválido";
    if (formData.password.length < 6) newErrors.password = "Mínimo 6 caracteres";
    if (formData.password !== formData.confirmPassword)
      newErrors.confirmPassword = "No coincide";

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validate()) {
      alert("Formulario enviado");
      setFormData({
        nombre: "",
        email: "",
        password: "",
        confirmPassword: "",
      });
    }
  };

  const styles = {
    container: {
      width: "400px",
      margin: "auto",
      fontFamily: "Arial, sans-serif",
    },
    formGroup: {
      marginBottom: "15px",
    },
    label: {
      display: "block",
      marginBottom: "5px",
    },
    input: {
      width: "100%",
      padding: "10px",
      border: "1px solid #ccc",
      borderRadius: "4px",
      fontSize: "16px",
      transition: "border 0.3s",
      boxSizing: "border-box",
    },
    inputError: {
      borderColor: "red",
    },
    inputFocus: {
      borderColor: "#007bff",
      outline: "none",
    },
    errorText: {
      color: "red",
      fontSize: "14px",
      marginTop: "5px",
    },
    button: {
      padding: "10px 20px",
      backgroundColor: "#007bff",
      color: "#fff",
      border: "none",
      borderRadius: "4px",
      fontSize: "16px",
      cursor: "pointer",
    },
  };

  return (
    <form style={styles.container} onSubmit={handleSubmit}>
      <div style={styles.formGroup}>
        <label style={styles.label}>Nombre Completo</label>
        <input
          type="text"
          name="nombre"
          value={formData.nombre}
          onChange={handleChange}
          onFocus={() => setFocusedField("nombre")}
          onBlur={() => setFocusedField("")}
          style={{
            ...styles.input,
            ...(errors.nombre && styles.inputError),
            ...(focusedField === "nombre" && styles.inputFocus),
          }}
        />
        {errors.nombre && <div style={styles.errorText}>{errors.nombre}</div>}
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>Email</label>
        <input
          type="email"
          name="email"
          value={formData.email}
          onChange={handleChange}
          onFocus={() => setFocusedField("email")}
          onBlur={() => setFocusedField("")}
          style={{
            ...styles.input,
            ...(errors.email && styles.inputError),
            ...(focusedField === "email" && styles.inputFocus),
          }}
        />
        {errors.email && <div style={styles.errorText}>{errors.email}</div>}
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>Contraseña</label>
        <input
          type="password"
          name="password"
          value={formData.password}
          onChange={handleChange}
          onFocus={() => setFocusedField("password")}
          onBlur={() => setFocusedField("")}
          style={{
            ...styles.input,
            ...(errors.password && styles.inputError),
            ...(focusedField === "password" && styles.inputFocus),
          }}
        />
        {errors.password && <div style={styles.errorText}>{errors.password}</div>}
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>Confirmar Contraseña</label>
        <input
          type="password"
          name="confirmPassword"
          value={formData.confirmPassword}
          onChange={handleChange}
          onFocus={() => setFocusedField("confirmPassword")}
          onBlur={() => setFocusedField("")}
          style={{
            ...styles.input,
            ...(errors.confirmPassword && styles.inputError),
            ...(focusedField === "confirmPassword" && styles.inputFocus),
          }}
        />
        {errors.confirmPassword && (
          <div style={styles.errorText}>{errors.confirmPassword}</div>
        )}
      </div>

      <button type="submit" style={styles.button}>
        Enviar
      </button>
    </form>
  );
};

export default Formulario;
